"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e=[{abbreviation:"agriculture",about:"Agriculture is the science and art of cultivating plants and livestock.[1] Agriculture was the key development in the rise of sedentary human civilization, whereby farming of domesticated species created food surpluses that enabled people to live in cities. The history of agriculture began thousands of years ago. After gathering wild grains beginning at least 105,000 years ago, nascent farmers began to plant them around 11,500 years ago. Pigs, sheep and cattle were domesticated over 10,000 years ago. Plants were independently cultivated in at least 11 regions of the world. Industrial agriculture based on large-scale monoculture in the twentieth century came to dominate agricultural output, though about 2 billion people still depended on subsistence agriculture into the twenty-first.",description:"Food ",image:"https://gitlab.com/auproxis/images/raw/master/farming.jpg",issue_id:2,name:"Agriculture",vids:"https://www.youtube.com/watch?v=Qmla9NLFBvU"},{abbreviation:"armed_forces",about:"The United States Armed Forces are the military forces of the United States of America. It consists of the Army, Marine Corps, Navy, Air Force, and Coast Guard.[11] The president of the United States is the commander-in-chief of the Armed Forces and forms military policy with the Department of Defense (DoD) and Department of Homeland Security (DHS), both federal executive departments, acting as the principal organs by which military policy is carried out. All five armed services are among the seven uniformed services of the United States. From the time of its inception, the U.S. Armed Forces played a decisive role in the history of the United States. A sense of national unity and identity was forged as a result of victory in the First Barbary War and the Second Barbary War. Even so, the founders of the United States were suspicious of a permanent military force. It played a critical role in the American Civil War, continuing to serve as the armed forces of the United States, although a number of its officers resigned to join the military of the Confederate States. The National Security Act of 1947, adopted following World War II and during the Cold War's onset, created the modern U.S. military framework. The Act established the National Military Establishment, headed by the secretary of defense; and created the Department of the Air Force and the National Security Council. It was amended in 1949, renaming the National Military Establishment the Department of Defense, and merged the cabinet-level Department of the Army, Department of the Navy, and Department of the Air Force, into the Department of Defense.",description:"Warfare ",image:"https://gitlab.com/auproxis/images/raw/master/armed-forces.jpg",issue_id:3,name:"Armed Forces",vids:"https://www.youtube.com/watch?v=lPkr7ZqhCV0"},{abbreviation:"crimes",about:'In ordinary language, a crime is an unlawful act punishable by a state or other authority.[1] The term "crime" does not, in modern criminal law, have any simple and universally accepted definition,[2] though statutory definitions have been provided for certain purposes.[3] The most popular view is that crime is a category created by law; in other words, something is a crime if declared as such by the relevant and applicable law.[2] One proposed definition is that a crime or offence (or criminal offence) is an act harmful not only to some individual but also to a community, society, or the state ("a public wrong"). Such acts are forbidden and punishable by law. The notion that acts such as murder, rape, and theft are to be prohibited exists worldwide.[5] What precisely is a criminal offence is defined by criminal law of each country. While many have a catalogue of crimes called the criminal code, in some common law countries no such comprehensive statute exists.',description:"Crime  ",image:"https://gitlab.com/auproxis/images/raw/master/crime.jpg",issue_id:4,name:"Crime And Law Enforcement",vids:"https://www.youtube.com/watch?v=CNcgUdPacyo"},{abbreviation:"economics",about:"Economics (/ɛkəˈnɒmɪks, iːkə-/)[1][2][3] is the social science that studies the production, distribution, and consumption of goods and services. Economics focuses on the behaviour and interactions of economic agents and how economies work. Microeconomics analyzes basic elements in the economy, including individual agents and markets, their interactions, and the outcomes of interactions. Individual agents may include, for example, households, firms, buyers, and sellers. Macroeconomics analyzes the entire economy (meaning aggregated production, consumption, saving, and investment) and issues affecting it, including unemployment of resources (labour, capital, and land), inflation, economic growth, and the public policies that address these issues (monetary, fiscal, and other policies).",description:"Wealth ",image:"https://gitlab.com/auproxis/images/raw/master/economy.jpg",issue_id:5,name:"Economics",vids:"https://www.youtube.com/results?search_query=US+economy"},{abbreviation:"education",about:"Education is the process of facilitating learning, or the acquisition of knowledge, skills, values, beliefs, and habits. Educational methods include storytelling, discussion, teaching, training, and directed research. Education frequently takes place under the guidance of educators, however learners may also educate themselves.[1] Education can take place in formal or informal settings and any experience that has a formative effect on the way one thinks, feels, or acts may be considered educational. The methodology of teaching is called pedagogy. Formal education is commonly divided formally into such stages as preschool or kindergarten, primary school, secondary school and then college, university, or apprenticeship. A right to education has been recognized by some governments and the United Nations.[2] In most regions, education is compulsory up to a certain age. There is a movement for education reform, and in particular for the of evidence-based education.",description:"1+1 = ?",image:"https://gitlab.com/auproxis/images/raw/master/college.jpg",issue_id:6,name:"Education",vids:"https://www.youtube.com/watch?v=pvXJnukCFoo"},{abbreviation:"emergency_management",about:"Emergency management is the organization and management of the resources and responsibilities for dealing with all humanitarian aspects of emergencies (preparedness, response, mitigation, and recovery). The aim is to reduce the harmful effects of all hazards, including disasters. The World Health Organization defines an emergency as the state in which normal procedures are interrupted, and immediate measures need to be taken to prevent that state turning into a disaster. Thus, emergency management is crucial to avoid the disruption transforming into a disaster, which is even harder to recover from. Emergency management is a related term but should not be equated to disaster management.",description:"First-Responders  ",image:"https://gitlab.com/auproxis/images/raw/master/emergency.jpg",issue_id:7,name:"Emergency Management",vids:"https://www.youtube.com/watch?v=00OoD3_aemQ"},{abbreviation:"environmentalism",about:"Every day, the earth crawls closer to irreversible catastrophe thanks to our own actions. See what your politician is doing to stop us from all burning alive here.",description:"Earth ",image:"https://gitlab.com/auproxis/images/raw/master/nature.jpg",issue_id:8,name:"Environmentalism",vids:"https://www.youtube.com/watch?v=rhQVustYV24"},{abbreviation:"gun_control",about:"With a steady increase in mass shooting over the years, gun control has become a contentious topic. See what your politician has been saying about limiting the distribution of weapons here.",description:"Weapons ",image:"https://gitlab.com/auproxis/images/raw/master/gun.jpg",issue_id:9,name:"Gun Control",vids:"https://www.youtube.com/watch?v=up1Wb2Q_WMk"},{abbreviation:"healthcare",about:"With the cost of medical care so high, some form of insurance is absolutely necessary to survival. See what your politician thinks about subsidizing a basic necessity for the masses.",description:"Health-Coverage ",image:"https://gitlab.com/auproxis/images/raw/master/medical.jpg",issue_id:10,name:"Healthcare",vids:"https://www.youtube.com/watch?v=ZHt-_NlHZAU"},{abbreviation:"housing_and_community_development",about:'The United Nations defines community development as "a process where community members come together to take collective action and generate solutions to common problems."[1] It is a broad concept, applied to the practices of civic leaders, activists, involved citizens, and professionals to improve various aspects of communities, typically aiming to build stronger and more resilient local communities. Community development is also understood as a professional discipline, and is defined by the International Association for Community Development (www.iacdglobal.org), the global network of community development practitioners and scholars, as "a practice-based profession and an academic discipline that promotes participative democracy, sustainable development, rights, economic opportunity, equality and social justice, through the organisation, education and empowerment of people within their communities, whether these be of locality, identity or interest, in urban and rural settings".',description:"Homlessness/Gentrification/Rent/Growth ",image:"https://gitlab.com/auproxis/images/raw/master/housing.jpg",issue_id:11,name:"Housing and Community Development",vids:"https://www.youtube.com/watch?v=6BKZmH4y4GE"},{abbreviation:"immigration",about:"America has a long and storied history of relying on immigrants to do much of the backbreaking labor... and despising them for taking that work at the same time. See what your politician has been saying in this cycle of the fight.",description:"Global-Movement ",image:"https://gitlab.com/auproxis/images/raw/master/fence.jpg",issue_id:12,name:"Immigration",vids:"https://www.youtube.com/watch?v=ZmOKKY9shiQ"},{abbreviation:"labor_and_employment",about:"Wage labour (also wage labor in American English) is the socioeconomic relationship between a worker and an employer, where the worker sells their labour power under a formal or informal employment contract.[1] These transactions usually occur in a labour market where wages or salaries are market-determined. In exchange for the money paid as wages (usual for short-term work-contracts) or salaries (in permanent employment contracts), the work product generally becomes the undifferentiated property of the employer, except for special cases such as the vesting of intellectual property patents in the United States where patent rights are usually vested in the employee personally responsible for the invention. A wage labourer is a person whose primary means of income is from the selling of their labour in this way.",description:"Work ",image:"https://gitlab.com/auproxis/images/raw/master/labor.jpg",issue_id:13,name:"Labor and Employment",vids:"https://www.youtube.com/results?search_query=US+employment"},{abbreviation:"social_issues",about:"A social issue is a problem that influences many individuals within a society. A social issue has many categories in depth as well as light. It's a common problem we see happening in our society. A social issue can be considered as a problem that influences many people and many peoples strive to solve the issue. It is often the consequence of factors extending beyond an individual's control, and is the source of a conflicting opinion on the grounds of what is perceived as morally correct or incorrect personal life or Interpersonal social life. Social issues are distinguished from economic issues; however, some issues (such as immigration) have both social and economic aspects. There are also issues that don't fall into either category, such as warfare.",description:"Ethics/Change/Rights ",image:"https://gitlab.com/auproxis/images/raw/master/social.jpg",issue_id:14,name:"Social Issues",vids:"https://www.youtube.com/watch?v=3m2QCkXiq_A"},{abbreviation:"taxation",about:"A tax (from the Latin taxo) is a compulsory financial charge or some other type of levy imposed upon a taxpayer (an individual or legal entity) by a governmental organization in order to fund various public expenditures.[1] A failure to pay, along with evasion of or resistance to taxation, is punishable by law. Taxes consist of direct or indirect taxes and may be paid in money or as its labour equivalent. The first known taxation took place in Ancient Egypt around 3000-2800 BC. Most countries have a tax system in place to pay for public, common or agreed national needs and government functions. Some levy a flat percentage rate of taxation on personal annual income, but most scale taxes based on annual income amounts. Most countries charge a tax on individuals income as well as on corporate income. Countries or subunits often also impose wealth taxes, inheritance taxes, estate taxes, gift taxes, property taxes, sales taxes, payroll taxes or tariffs.",description:"Government-Funding ",image:"https://gitlab.com/auproxis/images/raw/master/tax.jpg",issue_id:15,name:"Taxation",vids:"https://www.youtube.com/results?search_query=us+taxes"},{abbreviation:"transportation_and_public_works",about:"Transport or transportation is the movement of humans, animals and goods from one location to another. In other words, the action of transport is defined as a particular movement of an organism or thing from a point A to a Point B. Modes of transport include air, land (rail and road), water, cable, pipeline and space. The field can be divided into infrastructure, vehicles and operations. Transport enables trade between people, which is essential for the development of civilizations. Transport infrastructure consists of the fixed installations, including roads, railways, airways, waterways, canals and pipelines and terminals such as airports, railway stations, bus stations, warehouses, trucking terminals, refueling depots (including fueling docks and fuel stations) and seaports. Terminals may be used both for interchange of passengers and cargo and for maintenance. Vehicles traveling on these networks may include automobiles, bicycles, buses, trains, trucks, helicopters, watercraft, spacecraft and aircraft.",description:"Vehicles ",image:"https://gitlab.com/auproxis/images/raw/master/transportation.jpg",issue_id:16,name:"Transportation and Public Works",vids:"https://www.youtube.com/watch?v=lqgtk4ozgsg"}];exports.default=e;
